import React, { useState } from 'react';

const ContactMe = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    subject: '',
    message: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission logic here
    console.log('Form submitted:', formData);
  };

  return (
    <div id="contactme" className="contactus-form-container py-16">
      <div className="container mx-auto px-4">

        <h1 className="text-4xl font-bold text-center text-orange-600">Contact me</h1>

        <h3 className="text-xl text-center mt-4 mb-8">
          Questions, thoughts, or just want to say hello?
        </h3>

        <div className="contactus-form-container max-w-lg mx-auto">
          <form className="form" onSubmit={handleSubmit}>
            <div className="formfield-container space-y-4">
              <input
                className="formfield p-4 border rounded-md w-full"
                type="text"
                name="name"
                value={formData.name}
                onChange={handleChange}
                placeholder="Enter your name"
              />

              <input
                className="formfield p-4 border rounded-md w-full"
                type="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                placeholder="Enter your email address"
              />

              <input
                className="formfield p-4 border rounded-md w-full"
                type="text"
                name="subject"
                value={formData.subject}
                onChange={handleChange}
                placeholder="Enter your subject"
              />

              <textarea
                name="message"
                value={formData.message}
                onChange={handleChange}
                cols="30"
                rows="10"
                className="formfield formfield-textarea p-4 border rounded-md w-full"
                placeholder="Enter your message"
              ></textarea>
            </div>

            <div className="text-center mt-6">
              <button type="submit" className="btn-pink py-2 px-6 bg-pink-600 text-white rounded-md flex items-center justify-center hover:bg-pink-700">
                Send Message
                <i className="submit-icon fa-solid fa-paper-plane ml-2"></i>
              </button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default ContactMe;
